import './Photos.css';
import './Photos_responsive.css';

const Photos = () => {
    return(
        <div className="photos">
            <div className="grid-4-cols photos-col">
                <div name='1' id='photo-grid-a' className="grid-1-3-full grid-1-2-mini photo-grid"></div>
                <div name='2' id='photo-grid-b' className="grid-3-4-full grid-1-2-mini photo-grid"></div>
                <div name='3' id='photo-grid-c' className="grid-4-5-full grid-1-2-mini photo-grid"></div>
                <div name='4' id='photo-grid-d' className="grid-1-2-full grid-2-3-mini photo-grid"></div>
                <div name='5' id='photo-grid-f' className="grid-2-3-full grid-2-3-mini photo-grid"></div>
                <div name='6' id='photo-grid-h' className="grid-3-5-full grid-2-3-mini photo-grid"></div>
            </div>
        </div>
    )
}
export default Photos;
